import React from 'react';
import { BsHouseDoor } from "react-icons/bs";
import { NavLink } from 'react-router-dom';
import { BsChatLeftDots } from "react-icons/bs";
import { BsPersonBoundingBox } from "react-icons/bs";
import { BsFileCheck } from "react-icons/bs";

const Navbar = () => {
    return(
        <nav className='navbar under'>

            <NavLink to="/" className={({ isActive }) => (isActive ? 'active' : 'inactive')}><BsHouseDoor size={26}/></NavLink>
            <NavLink to="profile" className={({ isActive }) => (isActive ? 'active' : 'inactive')}><BsPersonBoundingBox size={26}/></NavLink>
            {/* <NavLink to="profile"><BsFileCheck size={26}/></NavLink> */}
        </nav>
    )
}

export default Navbar;
